import React from "react";

const Points = ({ point }) => {
  const getComponents = () => {
    const items = [];

    for (let i = 1; i <= point; i++) {
      items.push(<div>Strela</div>);
    }
  };

  return <div>{getComponents()}</div>;
};

export default Points;
